function AddUser() {
  return (
    <div>
      <form id="Username">
        <label htmlFor="username">Username</label>
        <input id="username" type="text"></input>
        <label >Age(Years)</label>
        <input id="age" type="number"></input>
      </form>
    </div>
  );
}

export default AddUser;
